const videoIds = []
const sites = []

sites.push(absoluteMotivation)
sites.push(mulliganBrother)
sites.push(redFrost)

let m
for (let i = 0; i < sites.length; i++) {
  let count = 0
  videoIds[i] = []
  while ((m = regex.exec(sites[i])) !== null) {
        // This is necessary to avoid infinite loops with zero-width matches
    if (m.index === regex.lastIndex) {
      regex.lastIndex++
    }
    // The result can be accessed through the `m`-variable.
    m.forEach((match, groupIndex) => {
      if (groupIndex === 1) {
        console.log(`Found match, group ${groupIndex}: ${match}`)
        if (match !== 'null' && count < 31) {   // 31 for each => 93 videos
          count++
          videoIds[i].push(match)
        }
      }
    })
  }
}

// about 93 is a good number, because the playlist repeats every 3 months,
// and on year wrap around it cycles well, i.e. 4*93=372 % 364/365 = low number
console.log('videoIds.*.length', videoIds.reduce((acc, siteVideos) => acc + siteVideos.length, 0))

// shuffle the videos such that each consecutive days are videos from different youtube channel
// and top and bottom videos alternate
const copy = videoIds
videoIds = []
let pickFromTop = true
let siteIndex = 0
while (copy.length > 0) {
  if (copy[siteIndex].length > 0) {
    if (pickFromTop) videoIds.push(copy[siteIndex].shift())
    else videoIds.push(copy[siteIndex].pop())
    pickFromTop = !pickFromTop
  } else {
        // remove the site array
    copy.splice(siteIndex, 1)
  }
  siteIndex = (siteIndex + 1) % copy.length
}

const playlistJSON = []
videoIds.forEach((vid, i) => {
  playlistJSON[i] = vid
})
console.log(playlistJSON)
fs.writeFile('src/website/playlist.json', JSON.stringify(playlistJSON), err => err && console.error(err))

